,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
unistr('    ''\D83D\DCDD Total Entries'' AS card_title,'),
'    TO_CHAR(COUNT(*)) AS card_value,',
'    NULL AS card_desc',
'FROM MOOD_LOGSSS',
'WHERE LOWER(user_id) = LOWER(:APP_USER)',
'  AND MOOD_DATE >= TRUNC(SYSDATE) - 6',
'',
'UNION ALL',
'',
'SELECT ',
unistr('    ''\D83D\DCC5 Last Entry'' AS card_title,'),
'    TO_CHAR(MAX(mood_date), ''DD-Mon-YYYY'') AS card_value,',
'    NULL AS card_desc',
'FROM MOOD_LOGSSS',
'WHERE LOWER(user_id) = LOWER(:APP_USER)',
'',
'UNION ALL',
'',
'SELECT ',
unistr('    ''\D83C\DF31 First Entry'' AS card_title,'),
'    TO_CHAR(MIN(mood_date), ''DD-Mon-YYYY'') AS card_value,',
'    NULL AS card_desc',
'FROM MOOD_LOGSSS',
'WHERE LOWER(user_id) = LOWER(:APP_USER);',
''))
