'    v_last DATE;',
'BEGIN',
'    -- Get last log for this user',
'    SELECT last_log_date INTO v_last',
'    FROM gamification_user',
'    WHERE username = :APP_USER;',
'',
'    -- Check if logged today',
'    IF v_last = TRUNC(SYSDATE) THEN',
'        NULL; -- already logged today',
'    ELSE',
'        -- Update streak',
'        UPDATE gamification_user',
'        SET ',
'            streak_count = CASE ',
'                              WHEN v_last = TRUNC(SYSDATE - 1) ',
'                              THEN streak_count + 1 ',
'                              ELSE 1 ',
'                           END,',
'            points = points + 10,',
'            last_log_date = TRUNC(SYSDATE),',
'            badge = CASE ',
'                        WHEN points >= 100 THEN ''Rising Star''',
'                        WHEN points >= 500 THEN ''Champion''',
'                        WHEN points >= 1000 THEN ''Legend''',
'                        ELSE ''Newbie''',
'                    END',
'        WHERE username = :APP_USER;',
'    END IF;',
'END;'))
,p_process_clob_language=>'PLSQL'
